import React from "react";

import BikeListItem from '../components/BikeListItem'

const BikeList = () => {

    // TODO: implement fetching
    let bikes = [
        {
            name: "Lastenrad 1"
        },
        {
            name: "Lastenrad 2"
        },
    ]

    return (
        <>
            <h1>Bike list</h1>

            <li>
                {bikes.map((bike) => (
                    <BikeListItem bike={bike}/>
                ))}
            </li>
        </>
    );
};

export default BikeList;
